// contracts/EducationalRecords.sol
pragma solidity ^0.8.0;

contract EducationalRecords {
    struct Record {
        string studentName;
        string institutionName;
        string courseName;
        string grade;
        uint date;
    }

    mapping(address => Record[]) public records;

    function addRecord(string memory _studentName, string memory _institutionName, string memory _courseName, string memory _grade) public {
        records[msg.sender].push(Record({
            studentName: _studentName,
            institutionName: _institutionName,
            courseName: _courseName,
            grade: _grade,
            date: block.timestamp
        }));
    }

    function getRecords(address _student) public view returns (Record[] memory) {
        return records[_student];
    }
}
